import React from 'react'
import { useLocation } from 'react-router-dom';

export const UserDetailBody=(props)=>{
    const location = useLocation();
    return(
        <div>
            <h1>{props.state}</h1>
            {"Estado: "+console.log(location.state)}
        </div>
    )
}
